import {ContextCountry} from ''

function Location()  {
    const [countries, setCountries] = useContext(ContextCountry)
    return (
        <>
        <h4>Choisis un continent :</h4>
        {countries.map(country => {
            return (
            <button>{country.name}</button>
            )          
        })}
        </> 
    ) 
}

export default Location
